import React from "react";
import styled from "styled-components";
import { Container, Row, Col } from "reactstrap";
import Header from "../topnavbar";

const birth = ({ children }) => {
  const PcWidth = styled.div`
    width: 40%;
  `;
  const MobileWidth = styled.div`
    width: 80%;
  `;
  const ContentsBody = styled(Col)`
    width: 100%;
    margin: 0;
    padding: 0;
  `;
  return (
    <div>
      {/*<Header />*/}

      <Container>
        <Row>
          <ContentsBody lg="4" md="2"></ContentsBody>
          <ContentsBody lg="4" md="8" xs="12">
            {children}
          </ContentsBody>
          <ContentsBody lg="4" md="2"></ContentsBody>
        </Row>
      </Container>
    </div>
  );
};

export default birth;
